import React from "react";
import { BrowserRouter as Router, Route,Switch, Routes } from "react-router-dom";
import Home from "./pages/Home";

const App = () => {
  return (
    <Router>
       <Switch>
        <Route path="/" exact>
          <Home />
        </Route>
        </Switch>
    </Router>
  );
};
export default App;
